import React from 'react';

export default class Contact extends React.Component{

    render(){

        return(
            <div style={decor.big}>
            <div style={decor.title}>
            <p style={decor.add}>Contact Us</p> 
            <p>chose category or create a new one</p>
            </div>
            <div style={decor.grid}>
            <div>
                <p>Adress</p>
                <p>Phone</p>
                <p>e-mail</p>
            </div>
                <p>Street....</p>
                <p>+34 7325743482</p>
                <p>contact@conception.com</p>
            </div>
        </div>
        )
    }
}
const decor={
    big:{
        width: '70%',
        margin: 'auto',
        paddingTop: '1em',
        paddingBottom: '2em'
    },
    add: {
        fontSize: '30px'
    },
    title: {
        textTransform: 'uppercase',
        textAlign: 'center',
        fontSize: '20px',
        borderBottom: '2px solid rgb(42, 43, 45)',
        padding: '1em'
    },
    grid:{
        display: 'grid',
        gridTemplateColumns: '1fr 1fr',
        gridGap: '3em',
        borderBottom: '2px solid rgb(42, 43, 45)',
        padding: '1em',
        paddingBottom: '4em'
    }
}
